export class BaiHoc {
    constructor(id = 0, tenBaiHoc = '', biDanh = '', maLoaiBai = '', maChuongHoc = '', danhSachCauHoi = []){
        this.id = id;
        this.tenBaiHoc = tenBaiHoc;
        this.biDanh = biDanh;
        this.maLoaiBai = maLoaiBai;
        this.maChuongHoc = maChuongHoc;
        this.danhSachCauHoi = danhSachCauHoi;
    }
}